import { commonDark } from '../../_styles/common';
import { tooltipDark } from '../../tooltip/styles';
const ellipsisDark = {
    name: 'Ellipsis',
    common: commonDark,
    peers: {
        Tooltip: tooltipDark
    }
};
export default ellipsisDark;
